export default {
  // 设置弹窗
  setDialog(state, data) {
    state.type = data.type
    state.message = data.message
    state.callback = data.callback
  },
  // 清空弹窗
  clearDialog(state) {
    state.type = null
    state.message = null
    state.callback = null
  },
}
